INSERT INTO `commerce4j`.`c4j_help` VALUES  (1,'Cómo proteger su privacidad en línea?','Nunca des tu contraseña a nadie en línea. Realiza tus contraseñas de al menos ocho caracteres de longitud y un máximo de 20. Crear una contraseña que incluye una combinación de números y letras. Si han caído en una estafa en línea y dio a conocer su contraseña, cambiar su contraseña de inmediato. Usted puede hacer esto entrando en la sección \"Mi cuenta\" y modificar la información de usuario. Una vez que haya terminado de navegar a través commerce4j, no deje el sitio Web abierto. La única manera de cerrar la sesión en el sitio es para cerrar la ventana.'),
 (2,'¿Cómo inscribirse?','Antes de comenzar a comprar, tiene que darse de alta con nosotros y nos dan la información que nos permitirá comunicarnos con usted acerca de sus transacciones. El registro es muy fácil con commerce4j. Tres de nuestras secciones es decir, la cesta de compra, lista de la compra y Mi cuenta están protegidos por contraseña. Al hacer clic en cualquiera de estos enlaces se llega a una página de acceso. Un nuevo usuario puede registrarse aquí o los miembros pueden acceder a su cuenta directamente.'),
 (3,'Cómo hacer un pedido?','Realizar un pedido con commerce4j es rápida y sencilla. A medida que examina la commerce4j, usted puede poner los artículos que desea comprar al instante en su carrito de compras haciendo clic en el enlace \"Añadir a la cesta de compra\". Enlace a la cesta de compra se proporciona con cada artículo que se muestra en la pantalla. Si no ha conectado todavía, se llega a la página de acceso.');
INSERT INTO `commerce4j`.`c4j_help` VALUES  (4,'Cómo commerce4j cuidar de su privacidad?','Estamos comprometidos a proteger su privacidad personal. commerce4j no dar a conocer su número de teléfono o dirección de correo electrónico, excepto cuando sea necesario para entregar un producto o servicio a su solicitud. No vamos a dar a conocer su número de tarjeta de crédito o cualquier información de la cuenta a menos que usted lo autorice, por ejemplo, procesar un pago con tarjeta de crédito. En otras palabras, no vamos a alquilar o vender su nombre, dirección, dirección de correo electrónico, información de tarjeta de crédito o detalles personales a ninguna tercera parte sin su permiso. Esta información se recoge, fundamentalmente, que somos capaces de satisfacer sus necesidades y para ofrecer una experiencia de compra verdaderamente personalizada. Sin embargo, debemos cooperar plenamente, debería surgir una situación, donde se nos requiere por ley o por obligación legal o proceso legal para proporcionar información sobre un cliente. Si usted ha comprado de nuestra tienda o suscrito a uno de nuestros boletines de noticias, de vez en cuando puede actualizar a través de e-mail de la llegada de nuevos productos especiales, características o sistemas de nuestro sitio.');
UNLOCK TABLES;
/*!40000 ALTER TABLE `c4j_help` ENABLE KEYS */;


